await robot.userRequest('老张来了吗');
const isLaoZhang = await robot.ask('您是老张吗？');

if(isLaoZhang=="是"){
    await robot.speak('老张你好，麻烦你帮我们修一下会议室的空调');
    await robot.goto('会议室');
    await robot.speak('辛苦老张了，我先回去了');
    await robot.goto('接待区');

}else{
    await robot.speak('欢迎，请您到前面的接待区稍作休息');
}

